import styles from '../BrandContainer/BrandContainer.module.css';

const BrandContainer = ({ brandingText, brandingImageUrl }) => {
    return (
        <div className={styles.div}>
            <div className={styles.branding}>{brandingText}</div>
            <div className={styles.weDesignDigitalContainer}>
                <p className={styles.weDesignDigital}>We design digital products used</p>
                <p className={styles.weDesignDigital}>by millions of people.</p>
            </div>
            <img className={styles.icon} alt="" src={brandingImageUrl} />
        </div>
    );
};

export default BrandContainer;
